  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:37.308862\",\n\t\"name\": \"mid-columbia-invasive-species-mapping-and-management-with-volunteers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Mid-Columbia River National Wildlife
  Refuge Complex proposed to survey, map, and ultimately control invasive species
  on Toppenish National Wildlife Refuge and adjacent Yakima Nation managed lands.
  We focused on 19 different invasive plants identified as priority species and Early
  Detection/ Rapid Response species in Yakima and Klickitat counties. An important
  element in this projectu2019s success was the involvement of local volunteers. Volunteer
  outreach was conducted through USFWS volunteers, Yakima Valley Audubon Society,
  and Heritage University. In addition, the Toppenish Refuge Youth ConservationCorps
  assisted with this project. A biotech/volunteer coordinator was hired for eight
  weeks to lead this project. The survey method was provided to us by Yakama Nation
  Wildlife Resource Management Program. The surveys were conducted on foot. When an
  invasive plant patch was found, a waypoint was entered into a GPA unit marking its
  location. These waypoints were later placed on an aerial map, which provided an
  overview look at the condition of the properties. In addition to the GPS waypoint,
  a photo was taken of the area and a survey form was completed for each patch found.
  The form required the surveyor to identify the weed species, specify the date of
  the visit, estimate the population area, cover of infestation, and population distribution,
  identify the plant community, state accessibility, provide a written description,
  and draw a hand map of the site. All of this information was organized ina data
  base and in binders to provide easy access to the information during treatment.\",\n\t\"license_title\":
